#include "embedia_model.h"

// Initialization function prototypes
spectrogram_layer_t init_melspec_data(void);
conv2d_layer_t init_conv2d_data(void);
conv2d_layer_t init_conv2d_1_data(void);
dense_layer_t init_dense_data(void);
dense_layer_t init_dense_1_data(void);


// Global Variables
spectrogram_layer_t melspec_data;
conv2d_layer_t conv2d_data;
conv2d_layer_t conv2d_1_data;
dense_layer_t dense_data;
dense_layer_t dense_1_data;


void model_init(){
    melspec_data = init_melspec_data();
    conv2d_data = init_conv2d_data();
    conv2d_1_data = init_conv2d_1_data();
    dense_data = init_dense_data();
    dense_1_data = init_dense_1_data();

}

void model_predict(data1d_t input, data1d_t * output){
  
    prepare_buffers();
    
    //*************** LAYER 0 **************//
    // Layer name: melspec
    data3d_t output0;
    create_spectrogram(melspec_data, input, &output0);
    
    
    //*************** LAYER 1 **************//
    // Layer name: conv2d
    data3d_t input1;
    input1 = output0;
    conv2d_layer(conv2d_data, input1, &output0);
    // Activation layer for conv2d
    relu_activation(output0.data, 10080);
    
    //*************** LAYER 2 **************//
    // Layer name: max_pooling2d
    input1 = output0;
    static const pooling2d_layer_t max_pooling2d_data = { 2, 2 };
    max_pooling2d_layer(max_pooling2d_data, input1, &output0);
    
    //*************** LAYER 3 **************//
    // Layer name: conv2d_1
    input1 = output0;
    conv2d_layer(conv2d_1_data, input1, &output0);
    // Activation layer for conv2d_1
    relu_activation(output0.data, 1664);
    
    //*************** LAYER 4 **************//
    // Layer name: flatten
    input1 = output0;
    data1d_t output1;
    flatten3d_layer(input1, &output1);
    
    //*************** LAYER 5 **************//
    // Layer name: dense
    data1d_t input2;
    input2 = output1;
    dense_layer(dense_data, input2, &output1);
    
    // Activation layer for dense
    relu_activation(output1.data, 32);
    
    //*************** LAYER 6 **************//
    // Layer name: dense_1
    input2 = output1;
    dense_layer(dense_1_data, input2, &output1);
    
    // Activation layer for dense_1
    softmax_activation(output1.data, 6);
    

    *output = output1;

}

int model_predict_class(data1d_t input, data1d_t * results){
  
   
    model_predict(input, results);
    
    return argmax(*results);
    //return argmax(data1d_t);

}

// Implementation of initialization functions


spectrogram_layer_t init_melspec_data(void){
    spectrogram_layer_t layer_spec;
    layer_spec.convert_to_db = 0;
    layer_spec.n_fft = 256;
    layer_spec.n_mels = 32;
    layer_spec.frame_length = 6000;
    layer_spec.sample_rate = 6000;
    layer_spec.n_blocks = 23;
    layer_spec.n_fft_table = 128;
    layer_spec.noverlap = 0;
    layer_spec.step = 256;
    layer_spec.len_nfft_nmels = 4;
    layer_spec.spec_size = 736;
    layer_spec.ts_us = 166;

    return layer_spec;
}
        

